import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-clientes',
  templateUrl: './clientes.component.html',
  styleUrls: ['./clientes.component.css']
})
export class ClientesComponent implements OnInit {


  clientes: any[] = [];

  ngOnInit(): void {
    this.clientes = [
      { name: 'Cliente 1', logo: './assets/client1.png' },
      { name: 'Cliente 2', logo: './assets/client2.png' },
      { name: 'Cliente 3', logo: './assets/client3.png' },
      { name: 'Cliente 4', logo: './assets/client4.png' },
      { name: 'Cliente 5', logo: './assets/client5.png' },
      { name: 'Cliente 6', logo: './assets/client6.png' }
    ];
  }

}
<div class="clientes-container">
  <div *ngFor="let cliente of clientes" class="cliente-card">
    <img [src]="cliente.logo" [alt]="cliente.name" class="cliente-logo">
  </div>
</div>
